pragma solidity >=0.4.0 <0.7.0;
pragma experimental ABIEncoderV2;
import "./models/TipoEnergia.sol";
import "./models/InfoContrato.sol";
import "./models/TipoEnergiaFactory.sol";

contract Comercializador {
    address public owner;
    address public dirContrato;
    address nullAddress = 0x0000000000000000000000000000000000000000;

    //Direccion del contrato que genero el contrato de comercializador
    address private dirFactory;
    string name;
    mapping(string => TipoEnergia) tiposEnergiasComercializador;
    mapping(address => uint256) tokensPorContrato;
    TipoEnergiaFactory factoryEnergia;

    constructor(
        string memory _name,
        address _direccion,
        address _dirFactory
    ) public {
        name = _name;
        owner = _direccion;
        dirFactory = _dirFactory;
        dirContrato = address(this);
        factoryEnergia = new TipoEnergiaFactory();
    }

    function getGeneradoresDisponibles()
        public
        view
        returns (infoContrato[] memory)
    {
        return IdirFactory(dirFactory).getGeneradoresOwners();
    }

    function comprarTokens(address _dirContrato, uint256 cantidad)
        public
        payable
        authorize(msg.sender)
    {
        // require(
        //     existeGenerador(_dirContrato) == true,
        //     "No existe ninguna contrato asociado a esta direccion"
        // );
        IGenerador(_dirContrato).ComprarTokens(msg.value, cantidad, msg.sender);
        uint256 numeroTokens = IGenerador(_dirContrato).MisTokens(msg.sender);
        tokensPorContrato[_dirContrato] = numeroTokens;
    }

    function existeGenerador(address _direction) private view returns (bool) {
        infoContrato[] memory tempContracts = getGeneradoresDisponibles();
        return
            IdirFactory(dirFactory).existsContract(_direction, tempContracts);
    }

    function getTokens(address _dirContrato) public view returns (uint256) {
        return tokensPorContrato[_dirContrato];
    }

    function MisTokens(address _dirContrato) public view returns (uint256) {
        return IGenerador(_dirContrato).MisTokens(msg.sender);
    }

    function ComprarEnergia(
        address _dirContrato,
        uint256 _cantidadEnergia,
        string memory nombreTipoEnergia
    ) public authorize(msg.sender) {
        IGenerador(_dirContrato).ComprarEnergia(
            _cantidadEnergia,
            nombreTipoEnergia,
            msg.sender
        );
        if (
            address(tiposEnergiasComercializador[nombreTipoEnergia]) ==
            nullAddress
        ) {
            tiposEnergiasComercializador[nombreTipoEnergia] = factoryEnergia
                .generarNuevaEnergia(nombreTipoEnergia, _cantidadEnergia);
        } else {
            tiposEnergiasComercializador[nombreTipoEnergia].addCantidadEnergia(
                _cantidadEnergia
            );
        }
    }

    function getDirFactory() public view returns (address) {
        return dirFactory;
    }

    function getEnergiaDisponible(string memory _nombreTipoEnergia)
        public
        view
        returns (uint256)
    {
        return
            tiposEnergiasComercializador[_nombreTipoEnergia]
                .getCantidadEnergia();
    }

    //_dirContrato : Direccion del contrato del generador de energia
    //numeroTokens : Numero de tokens que se quiere devolver
    function DevolverTokens(address _dirContrato, uint256 numeroTokens)
        public
        payable
        authorize(msg.sender)
    {
        IGenerador(_dirContrato).DevolverTokens(numeroTokens, msg.sender);
    }

    modifier authorize(address _direction) {
        require(
            _direction == owner,
            "No tiene permisos para ejecutar la transaccion"
        );
        _;
    }
}

interface IdirFactory {
    function getGeneradoresOwners()
        external
        view
        returns (infoContrato[] memory);

    function existsContract(
        address contractDir,
        infoContrato[] calldata arrayContracts
    ) external pure returns (bool);
}

interface IGenerador {
    function ComprarTokens(
        uint256 _ethers,
        uint256 numTokens,
        address payable _dirOwner
    ) external payable;

    function ComprarEnergia(
        uint256 cantidadEnergia,
        string calldata tipoEnergia,
        address _dirOwner
    ) external;

    function MisTokens(address _direction) external view returns (uint256);

    function DevolverTokens(uint256 numTokens, address payable _direction)
        external
        payable;
}
